    % - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
    %
    function out_h = h( this, in_1, ~, t )
      % Calculate the residual of the invariants h.

      % Extract properties
      l__1 = this.m_l__1;
      l__2 = this.m_l__2;
      Omega = this.m_Omega;

      % Extract inputs
      phi__1 = in_1(1);
      phi__2 = in_1(2);
      x__3 = in_1(3);
      q__4 = in_1(7);
      phi__1__dot = in_1(8);
      phi__2__dot = in_1(9);
      x__3__dot = in_1(10);
      q__4__dot = in_1(14);

      % Evaluate function
      t1 = -l__2 - q__4;
      t2 = sin(phi__2);
      t4 = sin(phi__1);
      t5 = t4 * l__1;
      out_1 = t2 * t1 - t5;
      t6 = -t1;
      t7 = cos(phi__2);
      t9 = cos(phi__1);
      t10 = t9 * l__1;
      out_2 = t7 * t6 + t10 - x__3;
      out_3 = Omega * t - phi__1;
      t12 = t6 * phi__2__dot;
      out_4 = phi__1__dot * t10 + t7 * t12 + q__4__dot * t2;
      out_5 = t2 * t12 + phi__1__dot * t5 - q__4__dot * t7 + x__3__dot;
      out_6 = -Omega + phi__1__dot;

      % Store outputs
      out_h = zeros(6, 1);
      out_h(1) = out_1;
      out_h(2) = out_2;
      out_h(3) = out_3;
      out_h(4) = out_4;
      out_h(5) = out_5;
      out_h(6) = out_6;
    end % h
